                        </li>
                        <li class=\"navItem2 nav-item position-relative\">
                            {% if is_granted('IS_AUTHENTICATED_FULLY') %}
                                <a class=\"navLink2 nav-link position-relative\" href=\"{{ path('logout') }}\">Logout</a>
                            {% else %}
                                <a class=\"navLink2 nav-link position-relative\" href=\"{{ path('login') }}\">Login</a>
                            {% endif %}
                        </li>
                    </ul>
                </div>
            </div>
        </nav>
